(function() {
    'use strict';

    angular
        .module( 'App', [
            'ui.bootstrap',
            'ngRoute',
            'ngSanitize'
        ]);
}());

(function() {
    'use strict';

    angular
        .module( 'App' )
        .config([ '$routeProvider', function( $routeProvider ) {
            $routeProvider
                .when( '/', {
                    templateUrl: '/templates/views/shot-list.html',
                    controller: 'ShotListCtrl'
                })
                .when( '/shot/:id', {
                    templateUrl: '/templates/views/shot.html',
                    controller: 'ShotCtrl'
                })
                .when( '/404', {
                    templateUrl: '/templates/views/404.html'
                })
                .otherwise({
                    redirectTo: '/404'
                });
        }]);
}());

(function() {
    'use strict';

    angular
        .module( 'App' )
        .config([ '$httpProvider', function( $httpProvider ) {
            $httpProvider.interceptors.push( 'HttpInterceptor' );
            localStorage.clientAccessToken = "7eff3e90ccc2bc4eec73ef87c1f8bf67f2006241454aee6fe2ef0b743ed1ba55";
        }]);
}());

(function() {
    'use strict';

    angular
        .module( 'App' )
        .constant( 'ServiceURL', {
            getShotsURI: 'https://api.dribbble.com/v1/shots?{page}&{perPage}&{accessToken}',
            getCurrentShotURI: 'https://api.dribbble.com/v1/shots/{id}?{accessToken}',
            getLikeURI: 'https://api.dribbble.com/v1/shots/{id}/like?{accessToken}'
        });
}());

(function() {
    'use strict';

    angular
        .module( 'App' )
        .constant( 'AlertMessages', {
            shotsListFail: 'Ocorreu um erro ao carregar a lista de shots. Tente novamente mais tarde.',
            currentShotFail: 'Ocorreu um erro ao carregar o shot. Tente novamente mais tarde.',
            likeShotFail: 'Ocorreu um erro ao curtir o shot. Tente novamente mais tarde.'
        });
}());

(function() {
    'use strict';

    angular
        .module( 'App' )
        .constant( 'URLParams', {
            page: 'page=',
            perPage: 'per_page=',
            accessToken: 'access_token='
        });
}());

(function() {
    'use strict';

    angular
        .module( 'App' )
        .directive( 'loading', [function() {
            return {
                restrict: 'E',
                link: function( scope, element, attrs ) {
                    var requests = 0;

                    scope.show = false;

                    scope.$on( 'loading:show', function() {
                        if ( requests === 0 ) {
                            scope.show = true;
                        }

                        requests++;
                    });
                    scope.$on( 'loading:hidden', function() {
                        if ( requests === 1 ) {
                            scope.show = false;
                            requests--;
                        } else if ( requests !== 0 ) {
                            requests--;
                        }
                    });
                },
                templateUrl: '/templates/directives/loading.html'
            };
        }]);
}());

(function() {
    'use strict';

    angular
        .module( 'App' )
        .directive( 'alertMessage', [function() {
            return {
                restrict : "E",
                scope : {
                    message : "@"
                },
                replace : true,
                transclude: true,
                templateUrl : "/templates/directives/alert-message.html"   
            };
        }]);
}());

(function() {
    'use strict';

    angular
        .module( 'App' )
        .directive( 'goTop', [function() {
            return {
				restrict: 'E',
				replace: true,
				template: '<div class="go-top"><span class="glyphicon glyphicon-chevron-up"></span></div>',
				link: function( scope, element, attrs ) {
					element.bind( 'click', function() {
						scrollTo( document.body, 0, 100 );
					});
				}
			};
        }]);
}());

(function() {
    'use strict';

    angular
        .module( 'App' )
        .factory( 'XHRFactory', [ '$http', function( $http ) {
            return {
                get: function( serviceURL ) {
                    return $http.get( serviceURL );
                },
                post: function( serviceURL, data ) {
                    return $http.post( serviceURL, data );
                },
                update: function( serviceURL, data ) {
                    return $http.put( serviceURL, data );
                },
                delete: function( serviceURL ) {
                    return $http.delete( serviceURL );
                }
            };
        }]);
}());

(function() {
    'use strict';

    angular
        .module( 'App' )
        .factory( 'HttpInterceptor', [ '$q', '$rootScope', function( $q, $rootScope ) {
            return {
                request: function( config ) {
                    $rootScope.$broadcast( 'loading:show' );
                    return config || $q.when( config );
                },
                response: function( response ) {
                    $rootScope.$broadcast( 'loading:hidden' );
                    return response || $q.when( response );
                },
                responseError: function( response ) {
                    $rootScope.$broadcast( 'loading:hidden' );
                    return $q.reject( response );
                }
            };
        }]);
}());

(function() {
    'use strict';

    angular
        .module( 'App' )
        .controller( 'ShotListCtrl', [ '$scope', 'ServiceURL', 'XHRFactory', 'AlertMessages', 'URLParams', function( $scope, ServiceURL, XHRFactory, AlertMessages, URLParams ) {
            // variveis
            var messages = AlertMessages,
                URLParams = URLParams,
                shotsPage = 1;

            // variveis expostas
            $scope.shots = [];
            $scope.shotSize = "";
            $scope.serviceFail = "";
            
            // funes expostas
            $scope.getShots = getShots;
            $scope.resizeShots = resizeShots;
            $scope.getMoreShots = getMoreShots;

            function init() {
                getShots();
            }

            function getShots() {
                var getShotsURL = ServiceURL.getShotsURI
                .replace( '{page}', URLParams.page + shotsPage )
                .replace( '{perPage}', URLParams.perPage + '12' )
                .replace( '{accessToken}',  URLParams.accessToken + localStorage.clientAccessToken );

                XHRFactory
                .get( getShotsURL )
                .then ( getShotsDone, getShotsFail );
            }

            function getShotsDone( response ) {
                var data = response.data;
                $scope.shots = $scope.shots.concat(data);
            }

            function getShotsFail( response ) {
                $scope.serviceFail = messages.shotsListFail;
            }

            function getMoreShots() {
                shotsPage = shotsPage + 1;
                getShots();
            }

            function resizeShots( size ) {
                $scope.shotSize = size;
            }

            init();
        }]);
}());

(function() {
    'use strict';

    angular
        .module( 'App' )
        .controller( 'ShotCtrl', [ '$scope', 'ServiceURL', 'XHRFactory', '$routeParams', 'AlertMessages', 'URLParams', function( $scope, ServiceURL, XHRFactory, $routeParams, AlertMessages, URLParams ) {
            // variveis
            var shotId = $routeParams.id,
                messages = AlertMessages;

            // variveis expostas
            $scope.shot = [];
            $scope.serviceFail = "";
            $scope.shotLiked = false;
            
            // funes expostas
            $scope.shotLike = shotLike;

            function init() {
                getCurrentShot();
            }

            function getCurrentShot() {
                var getCurrentShotURL = ServiceURL.getCurrentShotURI
                    .replace( '{id}', shotId )
                    .replace( '{accessToken}', URLParams.accessToken + localStorage.clientAccessToken );

                XHRFactory
                .get( getCurrentShotURL )
                .then ( getCurrentShotDone, getCurrentShotFail );
            }

            function getCurrentShotDone( response ) {
                $scope.shot = response.data;
            }

            function getCurrentShotFail( response ) {
                $scope.serviceFail = messages.currentShotFail;
            }

            function shotLike() {
                var shotLikeURL = ServiceURL.getLikeURI
                    .replace( '{id}', shotId )
                    .replace( '{accessToken}', URLParams.accessToken + localStorage.clientAccessToken );

                $scope.shotLiked = true;

                XHRFactory
                .post( shotLikeURL )
                .then ( shotLikeDone, shotLikeFail );
            }

            function shotLikeDone( response ) {
                console.log( response );
            }

            function shotLikeFail( response ) {
                $scope.serviceFail = messages.likeShotFail;
            }

            init();
        }]);
}());

